import React from "react";
import styled from "styled-components";

import DocumentComponent from "../components/documentation/DocumentComponent";

import Loading from "../components/generic/Loading";

import Stopwatch from "../components/timers/Stopwatch";
import Countdown from "../components/timers/Countdown";
import XY from "../components/timers/XY";
import Tabata from "../components/timers/Tabata";

const Container = styled.div`
  display: flex;
  justify-content: center;
  width: 100%;
`;

const Title = styled.div`
  font-size: 2rem;
`;

/**
 * You can document your components by using the DocumentComponent component
 */
const Documentation = () => {
  return (
    <Container>
      <div>
        <Title>Documentation</Title>
        <DocumentComponent
          title="Loading spinner "
          component={<Loading />}
          propDocs={[
            {
              prop: "size",
              description: "Changes the size of the loading spinner",
              type: "string",
              defaultValue: "medium",
            }
          ]}
        />
        <DocumentComponent
          title="Stopwatch "
          component={<Stopwatch controls={true} index={9999}/>}
          propDocs={[
            {
              prop: "controls",
              description: "Allow/Disallow individual control",
              type: "boolen",
              defaultValue: "true",
            },
            {
              prop: "index",
              description: "index of the Timer",
              type: "integer",
              defaultValue: "0",
            }
          ]}
        />
        <DocumentComponent
          title="Countdown "
          component={<Countdown controls={true} index={9999}/>}
          propDocs={[
            {
              prop: "controls",
              description: "Allow/Disallow individual control",
              type: "boolen",
              defaultValue: "true",
            },
            {
              prop: "index",
              description: "index of the Timer",
              type: "integer",
              defaultValue: "0",
            }
          ]}
        />
        <DocumentComponent
          title="XY "
          component={<XY controls={true} index={9999}/>}
          propDocs={[
            {
              prop: "controls",
              description: "Allow/Disallow individual control",
              type: "boolen",
              defaultValue: "true",
            },
            {
              prop: "index",
              description: "index of the Timer",
              type: "integer",
              defaultValue: "0",
            }
          ]}
        />

        <DocumentComponent
          title="Tabata"
          component={<Tabata controls={true} index={9999}/>}
          propDocs={[
            {
              prop: "controls",
              description: "Allow/Disallow individual control",
              type: "boolen",
              defaultValue: "true",
            },
            {
              prop: "index",
              description: "index of the Timer",
              type: "integer",
              defaultValue: "0",
            }
          ]}
        />

        <DocumentComponent
          title="Tabata"
          component={<Tabata controls={true} index={9999}/>}
          propDocs={[
            {
              prop: "controls",
              description: "Allow/Disallow individual control",
              type: "boolen",
              defaultValue: "true",
            },
            {
              prop: "index",
              description: "index of the Timer",
              type: "integer",
              defaultValue: "0",
            }
          ]}
        />
      </div>
    </Container>
  );
};

export default Documentation;
